import { useLocation } from "react-router-dom";
import "./TelaPosicao.css";
import BotaoPrecisao from "../../compontente/BotaoPrecisao/BotaoPrecisao.js";
import LivroEstante from "../../compontente/LivroEstante/LivroEstante";

function TelaPosicao() {
  const location = useLocation();
  var local = location.state.id;
  console.log(local);

  local[0].sort((a, b) => {
    return (a.position - b.position)
  });
  
  return (
    <>
      <div className="TelaPosicao">
        <div className="PosicaoEstante"></div>
      </div>
      {local[0].map((livro)=>{

        if(true){
           <LivroEstante /> 
        }

      })}
      <BotaoPrecisao
        localIda="/"
        dadosIda={"eae"}
        localVolta="/"
        dadosVolta={"eae"}
      />
    </>
  );
}

export default TelaPosicao;
